import { gql } from "@apollo/client";

const ADD_CLIENT = gql`
  mutation ($name: String!, $email: String!)
`;

const DELETE_CLIENT = gql`
  mutation ($id: ID!) {
    deleteClient(id: $id) {
      name
    }
  }
`;

export { DELETE_CLIENT };
